import React from 'react';
import logo from '../img/logo.png'
import './Navbar.css'
import { Link } from 'react-router-dom';
export default function Navbar() {
  const jwt_token = localStorage.getItem("token")
  if(jwt_token){
    return [
      
    ]
  }
  return (
    <div className='navbar'>
      <img src={logo}  alt='' />
      <ul className='nav-menu'>
        <Link to="/signup">
          <li>SingUp</li>
        </Link>
        <Link to="/signin">
          <li>SignIn</li>
        </Link>
        <Link to="/profile">
          <li>Profile</li>
        </Link>
        <Link to="/createPost">
          <li>Create Post</li>
        </Link>
      </ul>
    </div>
  )
}
